t with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://127.0.0.1/wp52/ecolife/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page-2','','','2018-10-05 02:00:03','2018-10-05 02:00:03','',0,'http://192.168.1.209/manhframework/?page_id=2',0,'page','',0),(2334,1,'2018-10-05 02:00:03','2018-10-05 02:00:03','[vc_row][vc_column][vc_column_text]\n<h2>Who we are</h2>\nOur website address is: <a href=\"http://roadthemes.com/\">roadthemes.com</a>[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]\n<h2>What personal data we collect and why we collect it</h2>\n<h3>Comments</h3>\nWhen visitors leave comments on the site we collect the data shown in the comments form, and also the visitor’s IP address and browser user agent string to help spam detection.\n\nAn anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.\n<h3>Media</h3>\nIf you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.\n<h3>Cookies</h3>\nIf you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.\n\nIf you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.\n\nWhen you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.\n\nIf you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.\n<h3>Embedded content from other websites</h3>\nArticles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.\n\nThese websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]\n<h2>How long we retain your data</h2>\nIf you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.\n\nFor users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]\n<h2>What rights you have over your data</h2>\nIf you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][vc_column_text]\n<h2>Where we send your data</h2>\nVisitor comments may be checked through an automated spam detection service.[/vc_column_text][/vc_column][/vc_row]','Privacy Policy','','publish','closed','open','','privacy-policy-2','','','2018-10-05 02:00:03','2018-10-05 02:00:03','',0,'http://192.168.1.209/sneaker/?page_id=3',0,'page','',0),(2335,1,'2018-10-05 06:31:25','2018-10-05 06:31:25','[woocommerce_cart]','Cart','','publish','closed','closed','','cart-2','','','2018-10-05 06:31:25','2018-10-05 06:31:25','',0,'http://192.168.1.209/sneaker/cart/',0,'page','',0),(2336,1,'2018-10-05 06:31:25','2018-10-05 06:31:25','','Shop','','publish','closed','closed','','shop-2','','','2018-10-05 06:31:25','2018-10-05 06:31:25','',0,'http://192.168.1.209/sneaker/shop/',0,'page','',0),(2337,1,'2018-10-05 06:31:25','2018-10-05 06:31:25','[woocommerce_checkout]','Checkout','','publish','closed','closed','','checkout-2','','','2018-10-05 06:31:25','2018-10-05 06:31:25','',0,'http://192.168.1.209/sneaker/checkout/',0,'page','',0),(2338,1,'2018-10-05 06:31:25','2018-10-05 06:31:25','[woocommerce_my_account]','My account','','publish','closed','closed','','my-a